import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';

import { 
  Container,
  Row,
  Col
} from "reactstrap";

import {
  UserDataProvider
} from "./dataproviders/DataProviders";

class App extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col>
            <UserDataProvider />
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
